    data: |
      SELECT + col0 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE col0 NOT IN ( col2 + - col0 + - 84 / - 83, + col2 );
  - name: tab1

outputs:
  - name: q7760.out
    data: |
      51
      85
      91
